import Head from 'next/head'

import Navbar from './Navbar';

const Layout = (props) => (
    <div>
        <Head>
            <title>Renzo</title>
        </Head>
        <Navbar />
        {props.children}
    <p>{new String(props.children[0])}</p>
    </div>
)

export default Layout;
